import React from "react";
import OrganSelect from "../Components/OrgansService.js";

const OrganList = ({organs}) => {
    const organList = organs.map(organ => {
        return (
         <OrganSelect 
         key={organ._id}
         name = {organs.name}

         />    
        )

    })

    return ( 
        <>
            <h1>
                {organList}
            </h1>
        </>
     );
}

export default OrganList;
